    width: 25%;
    padding: 4px 10px;
    background-color: #1D269A;
    color: #FAE6E5;
    border-radius: 45px;
    text-align: center;
    cursor: pointer;
    border: none;
`;
export const SignInBox = styled.div`
    width: 50%;
    font-family: unbounded, arial;
    background-color: #100C0C;
    color: #FAE6E5;
    justify-content: space-between;
    text-align: center;
    border-radius: 45px;
    padding: 10px 10px;
    margin-left: auto;
    margin-right: auto;
`;
